import { Component } from '@angular/core';

@Component({
  selector: 'app-header',
  templateUrl: './header.component.html',
  styleUrls: ['./header.component.css']
})
export class HeaderComponent {

}
<header>
    <div class="container">
        <a href="#" routerLink="/" class="logo"> Second Hand Shop</a>
        <nav>
            <ul>
                <li>
                    <a href="#" routerLink="/main-page"> Main</a>
                </li>
            </ul>
        </nav>
    </div>
</header>
